$(document).ready(function() {
    $('#DTBL_Servicios').DataTable({
        dom: 'B<"DataTableRowOptionsGroup mrg-top-10"l<".search-box-dtbl"f>><"table-responsive"t><"DataTableRowOptionsGroup"ip>',
        "ajax": {
            url: "consultas/tablas.php",
            type: "POST",
            data: { "target": 'lista-servicios' },
        },
        "columns": [{
                "data": "IDServicio",
                render: function(data, type, row) {
                    if (type === 'display') {
                        return '<span class="bgcolor-black rounded color-white pd5">' + data + '</span>';
                    }
                    return data;
                }
            },
            {
                "data": "NombreServicio"
            },
            {
                "data": "EncargadoServicio"
            },
            {
                "data": "IDServicio",
                render: function(data, type, row) {
                    if (type === 'display') {
                        return '<button onclick="Editar(' + data + ');" class="btn btn-success" actionable>Editar</button><button onclick="Eliminar(' + data + ');" class="btn btn-danger" actionable>Eliminar</button>';
                    }
                    return data;
                }
            },
        ],
        "order": [
            [0, "asc"]
        ],
        buttons: [
            {   
            extend: 'pdfHtml5',
            exportOptions: {
                columns: ':not(.accionesColDTBL)'
                }
            ,
            className: "btn btn-danger",
            filename: 'Lista de ambulancias - DIF San Felipe',
            title: 'Lista de ambulancias - DIF San Felipe',
            text: '<i class="fas fa-file-pdf" aria-hidden="true"></i> Descargar PDF',
            customize: function ( doc ) {
                doc.content.splice( 0, 0, {
                    margin: [ 0, 0, 0, 12 ],
                    width: 450,
                    alignment: 'center',
                    image: 'data:image/png;base64,'
                    } );
                },            
            }
        ],
        searching: true,
        'lengthMenu': [
            [10, 15, 20, 25, 50],
            [10, 15, 20, 25, 50]
        ],
        language: {
            "sProcessing": "Procesando...",
            "sLengthMenu": "Mostrar _MENU_ registros",
            "sZeroRecords": "No se encontraron resultados",
            "sEmptyTable": "Ningún dato disponible en esta tabla",
            "sInfo": "Mostrando registros del _START_ al _END_ de un total de _TOTAL_ registros",
            "sInfoEmpty": "Mostrando registros del 0 al 0 de un total de 0 registros",
            "sInfoFiltered": "(filtrado de un total de _MAX_ registros)",
            "sInfoPostFix": "",
            "sSearch": "Buscar:",
            "sUrl": "",
            "sInfoThousands": ",",
            "sLoadingRecords": "Cargando...",
            "oPaginate": {
                "sFirst": "Primero",
                "sLast": "Último",
                "sNext": "Siguiente",
                "sPrevious": "Anterior"
            },
            "oAria": {
                "sSortAscending": ": Activar para ordenar la columna de manera ascendente",
                "sSortDescending": ": Activar para ordenar la columna de manera descendente"
            }
        }
    });

    document.getElementById('btnRegistrar').addEventListener('click', function(e) {
        let POSTData = new FormData();
        POSTData.append('nombre', document.getElementById('A_Nombre').value);
        POSTData.append('encargado', document.getElementById('A_Encargado').value);
        POSTData.append('target', 'registrar-servicio');
        let xhr = new XMLHttpRequest();
        xhr.onreadystatechange = () => {
            if (xhr.readyState == 4 && xhr.status == 200) {
                let response = JSON.parse(xhr.responseText);
                EnableActions();
                if (response.code == 200) {
                    $('#DTBL_Servicios').DataTable().ajax.reload();
                    $('#MDL_Agregar').modal('hide');
                    ClearFields('#MDL_Agregar');
                }
                MostrarMensaje(response.content);
            } else if (xhr.readyState == 4 && xhr.status != 200) {
                EnableActions();
                MostrarMensaje("Ha ocurrido un error inesperado al realizar la consulta");
            }
        }
        xhr.onloadstart = () => {
            DisableActions();
        }
        xhr.onerror = () => {
            EnableActions();
        }
        xhr.open('POST', 'consultas/tablas.php');
        xhr.send(POSTData);
    });

    document.getElementById('btnEditar').addEventListener('click', function(e) {
        let POSTData = new FormData();
        POSTData.append('ID', document.getElementById('ID_Element').value);
        POSTData.append('nombre', document.getElementById('E_Nombre').value);
        POSTData.append('encargado', document.getElementById('E_Encargado').value);
        POSTData.append('target', 'editar-lugar');
        let xhr = new XMLHttpRequest();
        xhr.onreadystatechange = () => {
            if (xhr.readyState == 4 && xhr.status == 200) {
                let response = JSON.parse(xhr.responseText);
                EnableActions();
                if (response.code == 200) {
                    $('#DTBL_Servicios').DataTable().ajax.reload();
                    $('#MDL_Editar').modal('hide');
                    ClearFields('#MDL_Editar');
                }
                MostrarMensaje(response.content);
            } else if (xhr.readyState == 4 && xhr.status != 200) {
                EnableActions();
                MostrarMensaje("Ha ocurrido un error inesperado al realizar la consulta");
            }
        }
        xhr.onloadstart = () => {
            DisableActions();
        }
        xhr.onerror = () => {
            EnableActions();
        }
        xhr.open('POST', 'consultas/tablas.php');
        xhr.send(POSTData);
    });
});

function Eliminar(ID) {
    let POSTData = new FormData();
    POSTData.append('ID', ID);
    POSTData.append('target', 'eliminar-servicio');
    let xhr = new XMLHttpRequest();
    xhr.onreadystatechange = () => {
        if (xhr.readyState == 4 && xhr.status == 200) {
            let response = JSON.parse(xhr.responseText);
            EnableActions();
            if (response.code == 200) {
                $('#DTBL_Servicios').DataTable().ajax.reload();
            }
            MostrarMensaje(response.content);
        } else if (xhr.readyState == 4 && xhr.status != 200) {
            EnableActions();
            MostrarMensaje("Ha ocurrido un error inesperado al realizar la consulta");
        }
    }
    xhr.onloadstart = () => {
        DisableActions();
    }
    xhr.onerror = () => {
        EnableActions();
    }
    xhr.open('POST', 'consultas/tablas.php');
    xhr.send(POSTData);
}

function Editar(ID) {
    let POSTData = new FormData();
    POSTData.append('ID', ID);
    POSTData.append('target', 'obtener-servicio');
    let xhr = new XMLHttpRequest();
    xhr.onreadystatechange = () => {
        if (xhr.readyState == 4 && xhr.status == 200) {
            let response = JSON.parse(xhr.responseText);
            EnableActions();
            if (response.code == 200) {
                document.getElementById('ID_Element').value = response.content.IDServicio;
                document.getElementById('E_Nombre').value = response.content.NombreServicio;
                document.getElementById('E_Encargado').value = response.content.EncargadoServicio;
                $('#MDL_Editar').modal('show');
            } else {
                MostrarMensaje(response.content);
            }
        } else if (xhr.readyState == 4 && xhr.status != 200) {
            EnableActions();
            MostrarMensaje("Ha ocurrido un error inesperado al realizar la consulta");
        }
    }
    xhr.onloadstart = () => {
        DisableActions();
    }
    xhr.onerror = () => {
        EnableActions();
    }
    xhr.open('POST', 'consultas/tablas.php');
    xhr.send(POSTData);
}